            <Content title="DESIGN PERSUASIF" reverse="true">
                <Description>
                    <h2>Qu’est ce que c’est ?</h2>
                    <p>La persuasion encourage l’adoption de nouveaux comportements. Cela va de l’achat jusqu’à l’utilisation de nouvelles fonctionnalités d’un système par exemple. Elle peut également impacter les attitudes des utilisateurs. Les technologies persuasives sont de puissants leviers pour changer les habitudes des individus.  </p>
                </Description>
