                <Items title="Le déroulement">
                    <p>Il faut séduire les utilisateurs et leur donner envie. Il faut donc soigner le côté esthétique et la fluidité de votre plateforme. Vous devez également aguicher l’utilisateur en mettant en avant des éléments clés et en privilégiant les médias illustratifs.
                    Le graphisme doit être en cohérence avec votre stratégie et accompagner les parcours utilisateurs prédéfinis de manière fluide. Accrochez le regard, les internautes ne lisent plus.
                    Enfin, pensez à tester et adapter. Faites tester votre interface pour l’optimiser en conséquence.</p>
                </Items>
            </Content>
             <Content title="GAMIFICATION" reverse="true">
                <Description>
                    <h2>Qu’est ce que c’est ?</h2>
                    <p>La gamification est une méthode qui utilise les éléments du jeu pour renforcer l’engagement des apprenants lors des formations. Ses bénéfices sont le gain d’implication et de motivation de l’élève.  </p>
                </Description>
