                <Items title="Mise en oeuvre">
                    <p>C’est une technique issues des jeux vidéos, les techniques de gamification prennent tout leur sens sur des supports interactifs.</br>
                    - Il nous faut une partie “récompenses aléatoires” ce qui a pour but de renforcer l’implication et de diminuer l’effet négatif de la compétition.</br>
                    - Et aussi des Feedbacks instantanés ( Le fait de renvoyer au joueur une information immédiatement après la réalisation d’une action ) ce qui va permettre à l’utilisateur d’apprendre en rythme
                    </p>
                </Items>
