            <Content title="ICONOGRAPHIE">
                <Description>
                    <h1>Qu’est ce que c’est ?</h1>
                    <p>Les icônes, très connues de nos jours, elles parlent, inspirent, permettent l’assimilation rapide, la compréhension d’un système, sa facilité d’utilisation et son expérience utilisateur. Cependant, attention à ne pas utiliser une icon à plusieurs sens. Elle pourrait être mal interprété.  </p>
                </Description>
