            <Content title="MAQUETTAGE" reverse="true">
                <Description>
                    <h2>Qu’est ce que c’est ?</h2>
                    <p>L’étape du maquettage consiste à créer une ébauche de l’aspect visuel de votre interface. Elle vous permet de présenter au client un produit semblable à celui que vous avez imaginé pour lui afin de voir si tous ses besoins ont été pris en compte et retranscrits. Si ce n’est pas le cas, il est encore temps de lui apporter des modifications. Une fois la maquette entièrement validée, les développeurs peuvent commencer leur travail.   </p>
                </Description>
